;(function(){
  window.optimizely = window.optimizely || [];
  
  //This adds an event listener that watches for SPA page changes on /git/*
  function addGitPageRenderHandler(){
    var optGitPageRender = function(e){
      if (window.requestAnimationFrame){
        //Wait for other handers to finish, so the page is ready by the time we reactivate.
        window.requestAnimationFrame(function(){
          window.optimizely.push({type: 'activate'});
        });
      }else{
        //Old browser (IE9) fallback (has more flicker):
        setTimeout(function(){
          window.optimizely.push({type: 'activate'});
        }, 0);
      }
    };
    window.jQuery(document).on('GitPageRender', optGitPageRender);
    return optGitPageRender;
  }

  if (/^\/git(\/[a-z]+)?/.test(document.location.pathname)){
    //Wait for ready so that window.jQuery is ready, and the current page is established.
    $(document).ready(function(){
      //This process refreshes optimizely's page detection, causing it to detech SPA page changes.
      //A side effect is that it re-runs this shared code, so this prevents it from being added multiple times:
      if (!window.optGitPageRender) window.optGitPageRender = addGitPageRenderHandler();
      
      // From docs: Project JavaScript is the only module that is not executed again.
      //addGitPageRenderHandler(); //Project js version
    });
  }
})();
